import React, {useState} from "react";

const App = () => {

  const [item, setItem] = useState({
    userName: "",
    age: ""
  })

  function handleChange(e) {
    setItem(prev => {
      return({
        ...prev,
        [e.target.name]: e.target.value
      })
    })
  }

  console.log(item);

  return (
    <div >
      <form>
        <label htmlFor="user">Username</label>
        <input 
        id="user"
        type="text" 
        placeholder="item"
        name="item"
        value={item.userName}
        onChange={handleChange}
        />
        <label htmlFor="age">Age</label>
        <input 
        id="age"
        type="text" 
        placeholder="age"
        name="age"
        value={item.age}
        onChange={handleChange}
        />
      </form>

    </div>
  );
}

export default App;
